import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Table, Row, Col, Button } from 'react-bootstrap';

const Dashboard = () => {
  const token = localStorage.getItem("token");
  const [users, setUsers] = useState([]);
  const [role, setRole] = useState(null); // Track user role
  const navigate = useNavigate();

  // Fetch user role and data on component load
  useEffect(() => {
    const fetchUserRole = async () => {
      try {
        const response = await fetch("http://localhost:5000/api/role", { // API endpoint for user role
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        const result = await response.json();
        setRole(result.role); // Assuming API sends role as { role: "admin" or "user" }
      } catch (error) {
        console.error("Error fetching role:", error);
        navigate("/login"); // Redirect to login if there's an error
      }
    };

    const fetchUsers = async () => {
      try {
        const response = await fetch("http://localhost:5000/api/users", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        const result = await response.json();
        setUsers(result);
      } catch (error) {
        console.error("Error fetching users:", error);
      }
    };

    if (token) {
      fetchUserRole();
      fetchUsers();
    } else {
      navigate("/login");
    }
  }, [token, navigate]);

  // If role is not yet loaded, show a loading message
  if (!role) {
    return <h1>Loading...</h1>;
  }

  return (
    <div className="mt-5">
      <Row>
        <Col>
          <h1 className="text-center">
            {role === "admin" ? "Admin Dashboard" : "User Dashboard"}
          </h1>

          {role === "admin" ? (
            // Admin-specific dashboard
            <>
              <Button variant="primary" className="mb-3">
                Add New User
              </Button>
              <Table striped bordered hover responsive>
                <thead>
                  <tr>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map((user) => (
                    <tr key={user._id}>
                      <td>{user.name}</td>
                      <td>{user.email}</td>
                      <td>
                        <Button variant="warning" size="sm" className="me-2">
                          Edit
                        </Button>
                        <Button variant="danger" size="sm">
                          Delete
                        </Button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </>
          ) : (
            // User-specific dashboard
            <Table striped bordered hover responsive>
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                </tr>
              </thead>
              <tbody>
                {users.map((user) => (
                  <tr key={user._id}>
                    <td>{user.name}</td>
                    <td>{user.email}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          )}
        </Col>
      </Row>
    </div>
  );
};

export default Dashboard;
